        }

        console.log(data);
    };

    return (
        <>
            <h1>Login</h1>

            <input
                type="text"
                placeholder="Email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
            /><br/>

            <input
                type="text"
                placeholder="Senha"
                value={pass}
                onChange={(e) => setPass(e.target.value)}
            /><br/>

            <button onClick={() => loginAccount()}>
                Registrar
            </button>
        </>
    );
}

export default Login;
